import React from 'react'
import { View, Text, Platform, SafeAreaView, StyleSheet } from 'react-native'
import { RegularText, LightText, ExtraBoldText, MediumText } from '../components/Shared/StyledText'

export default function ProfileScreen() {
    return (
        <SafeAreaView style={styles.androidSafeArea}>
            <View style={styles.top}>
                <MediumText style={{
                    fontSize: 20,
                    fontWeight: '700'
                }}>Profile</MediumText>
            </View>
            <View style={styles.middle}>
                <View style={styles.inMiddle}>
                    <View style={styles.imageBoundary}></View>
                    <View style={{ justifyContent: 'center', }}>
                        <RegularText style={{
                            fontSize: 18,
                            fontWeight: '600',
                            marginBottom: 19
                        }}> Nyarko Betrand</RegularText>
                        <RegularText
                            style={{
                                color: 'gray'
                            }}> +233264774091</RegularText>
                    </View>
                </View>
                <View></View>
            </View>
            <View style={{ backgroundColor: 'green', flex: 6 }}></View>
        </SafeAreaView>
    )
}

const styles = StyleSheet.create({
    androidSafeArea: {
        flex: 1,
        paddingTop: Platform.OS === "android" ? StatusBar.currentHeight : 0,
        marginHorizontal: 10

    },
    top: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center'

    },
    middle: {

        flex: 2
    },
    inMiddle: {
        flexDirection: 'row'
    },
    imageBoundary: {
        height: 90,
        width: 90,
        borderRadius: 10,
        backgroundColor: 'blue',
        marginRight: 20
    }
})
